import React from "react";
import {Link} from "react-router-dom";
import './Navbar.css';

function Navbar(){
    return (<nav style={{display:'flex', background:"grey"}}>
        <h4 style={{marginRight:'10px'}}><Link to='/'>HOME</Link></h4>
        <h4 style={{marginRight:'10px'}}><Link to='/about'>A propos</Link></h4>
        <h4 style={{marginRight:'10px'}}><Link to='/events'>Stages</Link></h4>
        <h4 style={{marginRight:'10px'}}><Link to='/cours'>Cours de Danse</Link></h4>
        <h4 style={{marginRight:'10px'}}><Link to='/solidaire'>Activit√©s Solidaires</Link></h4>
        <h4 style={{marginRight:'10px'}}><Link to='/contact'>Contact</Link></h4>

    </nav>

    )}

export default Navbar;
